import './App.css';
import React from "react";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Navbars from './components/Navbar/Navbar';
import TopNav from './components/TopNavbar.js/TopNav';

function App() {
  return (
    <div className="App">
      <TopNav />
      <Navbars />
    </div>
  );
}

export default App;
